import React, { Component } from 'react';
import './Currency.css';

class Currency extends Component {

        render() {
            var {
                id,
                base,
                date,
                rates,
            } = this.props.data;
            return (
                <li className={"cryptocurrency " + id}>
                    <p className="cryptocurrency-name">{base}</p>
                    <p>{date}</p>
                    <p>EUR: {rates[0]}</p>
                    <p>GBP: {rates[1]}</p>
                    <p>USD: {rates[2]}</p>
                </li>
            );
        }
    }

    export default Currency;
